import React from "react";
import { Redirect, Route } from "react-router-dom";

function ProtectedRoute(props) {
    // Modify this
    const isAuthenticated = false;
    console.log("this", isAuthenticated);
    console.log(props);

    return (
        <Route
            {...restOfProps}
            render={(props) =>
                isAuthenticated ? (
                    <Component {...props} />
                ) : (
                    <Redirect to="/" />
                )
            }
        >
        </Route>
    );
}

export default ProtectedRoute;
